function App() {
  return (
    <>
      <section className='App-header'>
        <Canvas>
          { <pointLight position={[10, 10, 10]} /> }
          { <ambientLight /> }
          <Cylinder3d position={[-1.2, 0, 0]} />
          <Cylinder3d position={[1.2, 0, 0]} />
        </Canvas>

        <Canvas>
      <ambientLight intensity={1} />
      <spotLight position={[10, 10, 10]} angle={0.15} />
      <Box position={[-1.2, 0, 0]} />
      <Box position={[1.2, 0, 0]} />
    </Canvas>


      </section>
    </>
  );
}

export default App;
